import React, { useContext } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import LoginPage from './components/Loginpage';
import Header from './components/Header';
import Footer from './components/Footer';
import HomePage from './components/HomePage';
import TokenContext, { TokenProvider } from './components/TokenContext';
import 'bootstrap/dist/css/bootstrap.min.css';
import Search from './components/search/Search';

function App() {
  const { isLoggedIn } = useContext(TokenContext);
  return (
    <TokenProvider> {/* Ensure TokenProvider wraps the entire App */}
      <Router>
        <div>
          <Header />
          <div><br/></div>
          <Routes>
            {isLoggedIn ? (
              <Route path="/" element={<Navigate to="/home" />} />
            ) : (
              <Route path="/" element={<LoginPage />} />
            )}
            <Route path="/home" element={<AuthenticateRoute><HomePage /></AuthenticateRoute>} />
            <Route path="/search" element={<AuthenticateRoute><Search /></AuthenticateRoute>} />
            <Route path="*" element={<AuthenticateRoute><Navigate to="/" /></AuthenticateRoute>} />
          </Routes>
        </div>
      </Router>
    </TokenProvider>
  );
}

function AuthenticateRoute({ children }) {
  const { isLoggedIn } = useContext(TokenContext);
  console.log("is logged ->", isLoggedIn);
  return isLoggedIn ? children : <Navigate to="/" />;
}

export default App;
